import React,{useState} from 'react'
import './findProductAndServives.css'
import ListIcon from '@material-ui/icons/List';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Gridpapers from './Gridpapers';

function FindProductAndServives() {

    const [selected, setSelected] = useState('Overview');
    
    const mystyle={
        color: "black",
        background: "white",
        borderRadius:"25%",
        fontSize:"20px"
    }

    const onOverview=()=>{
        console.log("working")
        alert(`chalgaya ${selected}`,selected)
        return(
            
        <div className="fpas_papers">
            
                {/* <Gridpapers  /> */}
            </div> 
          
          
          
            // {/* <h1 style={{fontSize:"20px"}}> 
            // What is Lorem Ipsum?
            // </h1>
            // <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. 
            //     Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, 
            //     when an unknown printer took a galley of type and scrambled it to make a type specimen book. 
            //     It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially 
            //     unchanged.It was popularised in the 1960s with the release of Letraset sheets containing Lorem 
            //     Ipsum passages,and more recently with desktop publishing 
            //     software like Aldus PageMaker including versions of Lorem Ipsum </p>
            // </div> */}
        )
    }


    return (
        <div className="fpas-container">
            <h1 className="HeadingText">Comparison Page</h1>
            <br/><br/>
          
            <p className="para"><ListIcon /> {selected}</p>

            <div className="fpas_btn">
                <button value="Overview" onClick={onOverview, selected=(e)=>{e.target.value}} className="btn btn-1"><ListIcon style={mystyle} /> Overview</button>
                <button value="Screenshots" onClick={onOverview, selected=(e)=>{e.target.value}} className="btn btn-1"><ListIcon style={mystyle} /> ScreenShots</button>
                <button value="UserReviews" onClick={onOverview, selected=(e)=>{e.target.value}} className="btn btn-1"><ListIcon style={mystyle} /> UserReviews</button>
                <button value="Prices" onClick={onOverview, selected=(e)=>{e.target.value}} className="btn btn-1"><ListIcon style={mystyle} /> Prices</button>
            </div>

            {/* <div className="fpas_papers">
                <Gridpapers  />
            </div> */}
            
        </div>
    )
}

export default FindProductAndServives
